import ReportTabs from "./components/ReportTabs";
import AllList from "./components/AllList"
import WatchList from "./components/WatchList"
import BannedList from "./components/BannedList"
import UpdatedLogs from "./components/UpdatedLogs"
import React, {useEffect, useState} from "react";

function App() {
  const [page, setPage] = useState('AllList');

  return (
    <div>
      <h1>Most Wanted</h1>
      <ReportTabs setPage = {setPage}/>
      <div className="content"></div>
        {page === 'WatchList' ? <WatchList/> : null }
        {page === 'BannedList' ? <BannedList/> : null }
        {page === 'UpdatedLogs' ? <UpdatedLogs/> : null }
    </div>
  );
}

export default App;
